def get_training_set():
    training_set = []
    for _ in range(100):
        r1 = random.random()
        r2 = random.random()
        if random.random() > 0.5:
            r3 = random.random()
            t = 0
        else:
            r3 = r2 + r1
            t = 1
        training_set.append([[r1, r2, r3], [t, 1 - t]])
    return training_set


def get_training_set2():
    training_set = []
    for _ in range(200):
        r = random.randrange(0, 1000) / 100
        training_set.append([[r], [(math.sin(r) + 1) / 2]])
    return training_set


def get_training_set3():
    training_set = []
    with open("mnist_train.csv") as f:
        data = f.readlines()
        for example in data:
            example = example.split(",")
            label = [0, 0, 0, 0, 0, 0, 0, 0, 0]
            label[int(example[0]) - 1] = 1
            inp = [int(x) / 255 for x in example[1:]]
            training_set.append([inp, label])
    return training_set[:1000]


